import React, { useState, useEffect } from "react";
import { Paper, Grid } from "@material-ui/core";

import Slider from "./Slider";
import Arrow from "./Arrow";
import Dots from "./Dots";
import { useSpring, animated, useTransition, TransitionFn } from "react-spring";

function Profile() {
  const images = [
    {
      image1: "./images/1.png",
      image2: "./images/2.png",
      imagge3: "./images/3.png",
      image4: "./images/4.png",
    },
    {
      image1: "./images/1.png",
      image2: "./images/2.png",
      imagge3: "./images/3.png",
      image4: "./images/4.png",
    },
  ];

  const slidesThumb = [
    "./images/thumbs/1.png",
    "./images/thumbs/2.png",
    "./images/thumbs/3.png",
    "./images/thumbs/4.png",
  ];
  const [image] = useState([
    { title: "./images/1.png", id: 0 },
    { title: "./images/2.png", id: 1 },
    { title: "./images/3.png", id: 2 },
    { title: "./images/4.png", id: 3 },
  ]);

  return (
    <>
      <Grid
        container
        style={{
          position: "relative",
        }}
      >
        <Grid
          item
          xs={6}
          style={{
            position: "relative",
          }}
        >
          <Slider slides={images} slidesThumb={slidesThumb} />
          <Grid item xs={12} style={{ height: "50px" }}></Grid>
        </Grid>
      </Grid>
    </>
  );
}

export default Profile;
